import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Toolbar from '@material-ui/core/Toolbar'; 
import FacebookIcon from '@material-ui/icons/Facebook';
import EmailIcon from '@material-ui/icons/Email';
import SettingsIcon from '@material-ui/icons/Settings';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid'
import AssignmentIcon from '@material-ui/icons/Assignment';
import Hidden from '@material-ui/core/Hidden';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles({
    root:{
        backgroundColor:'rgba(0,0,0, .6)',
    },
    title:{
        fontWeight:'800'
    },
    social_btn:{
        color:'white',
    },
    nav_btn:{
        color:'white'
    }
})

export default function Navbar() {
    const classes = useStyles();

    return (
        <AppBar className={classes.root}>
            <Toolbar>
                <Grid container spacing={3}>
                    <Grid item>
                        <AssignmentIcon fontSize="large" />
                    </Grid>
                    <Grid item>
                        <Typography variant='h5' className={classes.title}>Muskey Tracker</Typography>
                    </Grid>
                    <Hidden only='xs'>
                        <Grid item>
                            <Button className={classes.nav_btn}>Fish/Tips</Button>
                        </Grid>
                        <Grid item>
                            <Button className={classes.nav_btn}>Photos</Button>
                        </Grid>
                        <Grid item>
                            <Button className={classes.nav_btn}>About</Button>
                        </Grid>
                        <Grid item>
                            <Button className={classes.nav_btn}>Contact</Button>
                        </Grid>
                    </Hidden>
                </Grid>
                <Hidden only='xs'>
                    <Grid container justify="flex-end">
                        <Button>
                            <FacebookIcon className={classes.social_btn}/>
                        </Button>
                        <Button>
                            <EmailIcon className={classes.social_btn}/>
                        </Button>
                        <Button>
                            <SettingsIcon className={classes.social_btn}/>
                        </Button>
                    </Grid>
                </Hidden>
                <Hidden only={['xl','lg','md','sm']}>
                    <IconButton edge="end">
                        <MenuIcon />
                    </IconButton>
                </Hidden>
            </Toolbar>
        </AppBar>
    )
}
